import React, { Component } from 'react';
import img from './2.jpg';

import './home.css';
import Photoplay from './photoplay';

class Home extends Component {

    constructor(props){
        super(props);
        this.state = {
            produstInfo:[
                {
                    title:"Y06",
                    msg:"很好用",
                    date:"2019/04/17"
                }
            ]
        }
    }

    render() {
        return (
            <div>
                <Photoplay />   {/* 引入图片轮播组件*/}
                <section className="new-product">
                    <p><b>最新上市</b></p>
                    <div className="new-product-msg">
                        <div className="new-product-item x">
                            <div className="product-img">
                                <img src={img} alt="产品图片"></img>
                            </div>
                            <div className="product-desc">dwqd
                                <div className="product-title">Y06</div>
                                <div className="product-detail">

                                </div>
                            </div>
                        </div>

                        <div className="new-product-item x">2</div>
                        <div className="new-product-item d">3</div>
                        <div className="new-product-item x">4</div>
                        <div className="new-product-item x">5</div>
                        <div className="new-product-item d">6</div>
                    </div>
                </section>

                <section className="special-product">
                    <p><b>特别推荐</b></p>
                    <div className="special-product-msg">
                        <div className="special-product-info x">
                            <div className="">
                                {/* <a href="http://baidu.com" >wqd</a> */}
                                <div></div>
                                <div>
                                    
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        );
    }
}

export default Home;
